import { Box } from '@chakra-ui/react';
import AllRoutes from './AllRoutes/AllRoutes';
import './App.css';
import Navbar from './Components/Navbar';

function App() {
  return <Box   backgroundImage="url('https://cdn.pixabay.com/photo/2016/09/08/04/12/programmer-1653351_960_720.png')"
  backgroundPosition="center"
  backgroundRepeat="no-repeat"
  backdropBlur={'md'}
  backgroundSize='contain'
  >
<Navbar/>
<AllRoutes/>
  </Box>
}

export default App;
